            <p>Poleg glasbenega sejmišča festival Tresk vsako leto razpiše vizualni natečaj, ki se je ob jubilejni izvedbi leta 2019 razširil v pet kategorij, ki so tako ali drugače povezanih z glasbenih založništvom. Nagrade v sodelovanju z zainteresiranimi podporniki se podeljuje za</p>

              <li><router-link class="" :to="{ path: '/najbolj-inovativen' }">najbolj inovativen pristop k oglaševanju in oblikovanju dogodka <i class="fa fa-external-link-square"></i></a></li>

<template id="najboljsi-videospot">
  <transition name="component-fade" appear>
    <div class="content-page d-flex">
      <div class="container">
        <nav class="navbar pl-0">
          <router-link class="btn btn-primary btn-back" :to="{ path: '/natecaji' }"><i class="fa fa-arrow-left"></i></a>
        </nav>
      <div class="row">
        <div class="col-12">
          <h1 class="display-6 center">1. NAJBOLJŠI VIDEOSPOT</h1>

            <p>Festival Tresk podeljuje edino nagrado za lokalne video ustvarjalce na glasbeni sceni, s čimer se trudimo, da bi žanr videospotov postal širše mišljen, kot tudi predvajan v mednarodnem prostoru. Tej kategoriji pritiče javna projekcija desetih izbranih finalistov na dogodku v Kinoteki, 28. Marca 2020, ki jo bo pospremila debata o stanju in možnostih lokalne video produkcije.</p>
            <p>Pozivamo k prijavi videospotov domačih ustvarjalcev, ki so nastali oz. so bili objavljeni med 12. aprilom 2019 in 3. aprilom 2020. Posameznik oz. posameznica lahko prijavi do največ tri glasbene videje.</p>

            <p><a href="https://tresk.si/d/natecaji/video" target="_blank"><strong>PRIJAVNI OBRAZEC </strong><i class="fa fa-external-link-square"></i></a></p>
        </div>
      </div>
    </div>
